import React, { Component } from 'react';
import { Link } from 'react-router-dom';

export default class Login extends Component {

    constructor(){
        super()
        this.state = {
            email:'',
            password:''
        }
    }
    handleEmail(text){
        this.setState({
            email:Text.target.value
        })
    }
    handlePassword(text){
        this.setState({
            email:Text.target.value
        })
    }
    login(){
        let obj = {}
        obj.email = this.state.email;
        obj.password = this.state.password;

        fetch('http://localhost:8000/',{
            header:{
                "Content-Type":"application/json"
            },
            method:'POST',
            body:JSON.stringify({obj})
        }).then
    }
    render() {

        return (
            <div className="card">
                
                    <div className="card">
                        <h1 className="headtext">LOGIN</h1>
                        <div className="card-body">
                            <form>
                                <div className="mb-3">
                                    <label htmlFor="exampleInputEmail1" className="form-label">Email address</label>
                                    <input type="email" className="form-control" onChange={(text) => {this.handleEmail(text)}} />
                                </div>
                                <div className="mb-3">
                                    <label htmlFor="exampleInputPassword1" className="form-label">Password</label>
                                    <input type="password" className="form-control" onChange={(text) => {this.handlePassword(text)}}/>
                                </div>
                                
                            </form>
                            <div className="btn">
                                <a className="btn btn-primary" type="button" style={{ marginRight: "40px" }} onClick={() =>{this.login()}}><Link to = "/home">Log in</Link></a>
                                <a className="btn btn-primary" role="button"><Link to = "/register">Sign Up</Link></a>
                            </div>
                        
                    </div>

                </div>


            </div>


        )
    }
}
